                    name: '陈尧',
                    userId: '121212KK474784',
                    id: '32455255'
                }, {
                    key: '4',
                    price: 22.25,
                    number: '1242KD55145',
                    tel: 13972840395,
                    name: '陈尧',
                    userId: '121212K474784',
                    id: '1245255'
                }
            ]
        }
    }
    onShowSizeChange(e, v) {

    }
    componentDidMount() {
        console.log(this.props)
    }
    render() {
        return (
            <div>
                <Row>
                    <Col span={24}>
                        <Table
                            size="middle"
                            bordered
                            columns={this.state.columns}
                            pagination={false}
                            dataSource={this.state.data}/>
